import React from "react";

const Footer = () => {
  return (
    <div>
      <footer id="footer" class="footer">
        <div class="copyright">
          &copy; Copyright{" "}
          <strong>
            <span>My House</span>
          </strong>
          . All Rights Reserved
        </div>
        {/* <div class="credits">
          Designed by <a href="https://bootstrapmade.com/"></a>
        </div> */}
      </footer>

     
    </div>
  );
};

export default Footer;
